var payloadText = document.getElementById('payload');
var truncateButton = document.getElementById('truncate');
function truncate(data) {
    return data.charAt(0).toUpperCase() + data.slice(1);
}
function uppercase(data) {
    return data.toUpperCase();
}
function lowercase(data) {
    return data.toLocaleLowerCase();
}
function truncateStyleText() {
    var bodyDiv = document.getElementById('bodyDiv');
    if (payloadText.value !== null) {
        var capitalized = truncate(payloadText.value);
        var upper = uppercase(payloadText.value);
        var lower = lowercase(payloadText.value);
        return (bodyDiv.innerHTML += "\n            <h2>Result</h2>\n            <ul > \n            <li>'Capitalized': ".concat(capitalized, "</li>\n            <li>'Upper': ").concat(upper, "</li>\n            <li>'Lower': ").concat(lower, "</li>\n            </ul>"));
    }
}
truncateButton.addEventListener('click', truncateStyleText);
